import { ReactComponent as Logo } from "./../../../utils/next.svg";



export const Pagination = ({ pages,currentPage }) => {
  return (
    <div className="pagination">
      <Logo className="prev outline button_pagination" />

      {pages &&
        pages.map((p) => (
          <button className={["outline", "button_pagination", currentPage === p ? "primary" : ""].join(" ")} key={p}>
            {" "}
            {p}{" "}
          </button>
        ))}

      <Logo className="next outline button_pagination" />
    </div>
  );
};
